"use strict";function inDev(togglerName,modalID){let active="active";const toggler=document.querySelectorAll(togglerName),modal=document.querySelector(modalID);toggler.forEach(elem=>{elem.addEventListener("click",e=>{e.preventDefault,modal.classList.add(active);let timerID=setTimeout(()=>{modal.classList.remove(active)},2e3)})})}inDev(".in-dev-toggler","#in-dev");